import "./Category.scss"

function Category() {
    const category = [1,2,3,4,5]
    return ( 
        <div className="category">
            {category.map(function(item,index) {
                return (
                    <button className="category_item">
                        {item}
                    </button>
                )
            })}
        </div>
     );
}

export default Category;
